    "quivira-national-wildlife-refuge-narrative-report-september-1-to-december-31-1957",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Quivira National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1957. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. Resource management is outlined;
    topics include grazing, haying, fur harvesting, and timber removal. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, fishing, and violations. Items of interest, N-R forms, and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
